INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "お！\nあそこに困ってそうな人発見！", 2, "春咲 ひより", 0, 0, 1001, 1, 0, 1.4, 0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "大切な人を\n守れるようになりたい…って", 2, "草野 優衣", 0, 0, 1002, 1, 0, 1.4, 0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "キミに必要な集中力と感性が", 2, "士条 怜", 0, 0, 1003, 1, 0, 1.4, 0, 1, "少しは磨かれると思いますよ。", 1, "フェンシングを始めてみては？");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "今日はなにして遊ぶ？", 2, "穂高 みそぎ", 0, 0, 1004, 1, 0, 1.5, 0, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "ねぇ、にいちゃん！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "ねぇ…", 2, "風宮 あかり", 0, 0, 1006, 1, 0, 1.4, 0, 1, "私といっしょに…\nいかない？", 1, "風宮あかりです");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "プリンたべたいのー", 2, "出雲 宮子", 0, 0, 1007, 1, 0, 1.5, 0, 1, "食べ物の恨みは怖いのー", 1, "出雲宮子なのー");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, "虹村 雪", 0, 0, 1008, 1, 0, 1.4, 0, 1, "いいよ。\n見られることは運命さ…", 1, "ボクは虹村雪。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, "柊杏奈", 0, 0, 1009, 1, 0, 1.4, 0, 1, "人呼んで「疾風の冥姫」!!", 1, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, "姫宮 真歩", 0, 0, 1010, 1, 0, 1.5, 0, 1, "ほんまおおきにやわ～♪", 1, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "生き別れたお兄ちゃんを探して\n三千世界！", 2, "衣之咲 璃乃", 0, 0, 1011, 1, 0, 1.4, 0, 1, "ここで会ったが\n100年目～！", 1, "衣之咲璃乃です！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "ち、超能力って…\n何のことかな～？", 2, "柏崎 初音", 0, 0, 1012, 1, 0, 1.4, 0, 1, "…って、お願い！\n誰にも言わないでおいて～！", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "一応カリスマ読モJKやってまっす！", 2, "美波 鈴奈", 0, 0, 1016, 1, 0, 1.4, 0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "東京は遊園地みたいなところさー", 2, "喜屋武 香織", 0, 0, 1017, 1, 0, 1.4, 0, 1, "でも、沖縄もとってもいいとこさー", 1, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "先生って呼ばれるのは\nくすぐったいから", 2, "支倉 伊緒", 0, 0, 1018, 1, 0, 1.4, 0, 1, "イオちゃんって呼んでね。", 1, "支倉伊緒です。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "あ！/\お兄ちゃ～ん\nまってよ～", 2, "茜 ミミ", 0, 0, 1020, 1, 0, 1.5, 0, 1, "ミミをおいてかないでぇ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "あの……\nふぇ……", 2, "栗林 くるみ", 0, 0, 1021, 1, 0, 1.5, 0, 1, "ふぇぇぇぇぇん……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "こんな私に貴重な時間を\n割いていただき、", 2, "風宮 より", 0, 0, 1022, 1, 0, 1.4, 0, 1, "なんてありがとうございます！", 1, "風宮よりです。\nあああああ！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "おにいちゃんどこいくの？\nえ？", 2, "北条 綾音", 0, 0, 1023, 1, 0, 1.5, 0, 1, "私こっち行きたいー\nね、早く早くー", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "ふ、不束者ですが\nどうぞ末永く…って、", 2, "天野 すずめ", 0, 0, 1025, 1, 0, 1.4, 0, 1, "これて何か違う…\nあああすみません！", 1, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "あなたは…運命の……\n伴侶……", 2, "倉石 恵理子", 0, 0, 1027, 1, 0, 1.4, 0, 1, "離しませんわ………\n絶対に…!!", 1, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, "佐々木 咲恋", 0, 0, 1028, 1, 0, 1.4, 0, 1, "…そうでしょ？？", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "ぇっと…\nキミ、私のこと知らないの?!", 2, "桜井 望", 0, 0, 1029, 1, 0, 1.4, 0, 1, "あはは、\n私もまだまだだなぁ～", 1, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "初めまして、\n私はニノン・ジュベール申すデス！", 2, "ニノン・ジュベール", 0, 0, 1030, 1, 0, 1.4, 0, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "デケデケデンっ！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "でもって私の隣にいるのが……\nえ、見えない？", 2, "上喜 しのぶ", 0, 0, 1031, 1, 0, 1.4, 0, 1, "おかしいですね……", 1, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "けんども\nそれには足りないモンが…", 2, "野戸まひる", 0, 0, 1033, 1, 0, 1.5, 0, 1, "そう、\nオラのボケに突っ込める相方が…！", 1, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "ちょっと緊張しちゃって…", 2, "綾瀬 ゆかり", 0, 0, 1034, 1, 0, 1.4, 0, 1, "ちょ\nちょっと一杯飲んできます…！", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "知らない人とは話しちゃいけないので", 2, "氷川 鏡華", 0, 0, 1036, 1, 0, 1.5, 0, 1, "これ以上お話しすることは…\nないです！", 1, "氷川鏡華…です");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "……あ、アラーム。", 2, "柏崎 栞", 0, 0, 1038, 1, 0, 1.4, 0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "柏崎…栞です。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "私、一人も友達がいなくて……", 2, "双葉 碧", 0, 0, 1040, 1, 0, 1.4, 0, 1, "野に咲く花が、\n唯一の話相手です。", 1, "ふ、双葉碧です。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, "三角 千歌", 0, 0, 1042, 1, 0, 1.4, 0, 1, "そう思っています。", 1, "三角千歌です。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "あぁ？\nお前のそいつの仲間か？", 2, "安芸 真琴", 0, 0, 1043, 1, 0, 1.4, 0, 1, "う、疑ってすまなかったな…", 1, "安芸真琴だ。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "生けとし生ける全ての者よ！", 2, "イリヤ・オーンスタイン", 0, 0, 1044, 1, 0, 1.4, 0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "わらわこそは夜を総べる者！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "ぐふふふふ……はっ！", 2, "遠見 空花", 0, 0, 1045, 1, 0, 1.4, 0, 1, "ｌク、クウカに何かご用ですか!?", 1, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, "宮坂たまき", 0, 0, 1046, 1, 0, 1.4, 0, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "それでは早速クエストに…", 2, "大神 美冬", 0, 0, 1048, 1, 0, 1.4, 0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, "大神美冬よ！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "クエストもバトルも\n掃除も洗濯も", 2, "星野静流", 0, 0, 1049, 1, 0, 1.4, 0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "星野静流だよ！");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "見ての通りの\nセクシー美少女で", 2, "玉泉美咲", 0, 0, 1050, 1, 0, 1.5, 0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, "アタシは玉泉美咲。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "？？？？", 2, "リマ", 0, 0, 1052, 1, 0, 1.4, 0, 1, "？？？？", 1, "？？？");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 2, "モニカ・ヴァイスヴィント", 0, 0, 1053, 1, 0, 1.5, 0, 1, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 2, "ペコリーヌ", 0, 0, 1058, 1, 0, 1.5, 0, 1, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 2, "コッコロ", 0, 0, 1059, 1, 0, 1.5, 0, 1, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 2, "キャル", 0, 0, 1060, 1, 0, 1.5, 0, 1, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。");
